INSERT INTO `users` VALUES (16,'dude','0481e59b66c0fa195c1c42717e3b21aabff59690','loulou@gmail.com',NULL,'Bon je joue tres mal de la guitare',NULL,82,1,4,1,'2010-04-09 18:31:32','2010-04-21 16:39:56',3),(17,'lolo','0481e59b66c0fa195c1c42717e3b21aabff59690','lolo@gmail.com',NULL,'lolo description',NULL,82,2,1,1,'2010-04-10 16:43:09','2010-04-21 16:40:14',2),(18,'test','0481e59b66c0fa195c1c42717e3b21aabff59690','plop@plop.fr',NULL,'I think music is in a real state of transition right now, like it was in the mid-60s. There\'s a whole new generation of kids coming up and I think the people who run record companies are either too old or too out of touch to get on the bandwagon quick enough. A lot of music is real shallow right now. People seem to be lost, to be groping for something and there aren\'t any leaders right now, no Beatles or Elvis Presley. ',NULL,1,1,1,1,'2010-04-10 18:34:01','2010-04-21 16:41:36',5),(23,'raoul','0481e59b66c0fa195c1c42717e3b21aabff59690','raoul@gmail.com',NULL,'Gut instinct. I knew I needed a good musician \'cause I\'m not and I knew I needed a good guitar player. I mostly play piano. I play drums like a songwriter; I don\'t do anything fancy, just play the beat and try not to get in the way. ',NULL,82,2,5,1,'2010-04-14 18:38:18','2010-04-21 16:42:14',2),(24,'sush','0481e59b66c0fa195c1c42717e3b21aabff59690','sush@yahoo.fr',NULL,'Passione par la musique, j\'adore le Hip-Hop, Rap, Metal fusion hyper toxic, le sang, les chaussons au pommes, et par dessus tout, les fondantas au chocolats.',NULL,82,3,4,1,'2010-04-16 01:30:25','2010-04-22 17:52:41',3),(25,'pierre','0481e59b66c0fa195c1c42717e3b21aabff59690','pierre@hotmail.com',NULL,'The song caused a big stir in the news industry. NBC called me up and Good Morning America wanted to talk to me about it. But I didn\'t want to talk about it because it\'s self-explanatory. I still don\'t think of myself as a songwriter. I think it\'s a big joke, you know; I\'m embarrassed about it. You know that song by Paul Simon, \"Faking It\"? Yeah well that\'s the way I feel. I think a lot of my friends who are songwriters feel that way. ',NULL,24,2,3,1,'2010-04-16 01:32:38','2010-04-21 16:42:45',6),(26,'plop','0481e59b66c0fa195c1c42717e3b21aabff59690','plip@plip.fr',NULL,'The smarmy, maudlin love songs are the easiest! One thing I\'m proud of on this album is I have a sense of humor. All the critics always said how serious the Eagles were. We never really took ourselves that seriously at all. We joked about it all the time, but maybe it didn\'t come through in the music. I think I finally managed to get some humor into my music on this album. It\'s a very dry humor, it\'s not your basic knee-slapping fart jokes, but it does come across. ',NULL,254,1,1,1,'2010-04-19 11:08:21','2010-04-21 16:43:26',7),(27,'kryz','ad7e582f3d230ef80746697e78d8b60cd864682e','o-conn_g@epitech.net',NULL,'',NULL,82,4,5,1,'2010-05-03 16:54:24','2010-05-03 16:54:24',7);
/*!40000 ALTER TABLE `users` ENABLE KEYS */;
